import { mount, route } from 'navi'
import SignIn from './pages/SignIn'
import SignUp from './pages/SignUp'
import React from 'react'

const App = mount({
  '/': route({
    title: 'Login',
    view: <SignIn />,
  }),
  '/register': route({
    title: 'Register',
    view: <SignUp />,
  }),
})
